import logo from '../images/logo.svg';
import { Link } from 'react-router-dom';


function Header() {
    return (
        <header className="header">
            <img src={logo} alt="картинка лого" className="header__logo hover"/>
            <Link to="/sign-up">
                рега
            </Link>
            <Link to="/sign-in">
                вход
            </Link>
        </header>
    );
}

export default Header;
